import starFull from './star_full.svg';
import starHalf from './star_half.svg';
import starEmpty from './star_empty.svg';
import './ratings.css'

export default function StarIcon({star}) {

    return (
        <>
        { 
            star === 1 ?
            <svg class="vp-pop vp-delay-1" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 40 40"><g mask="url(#icon-star-a)" fill-rule="evenodd"><rect fill="#E2E5EA" x="0" y="0" width="40" height="38"></rect><rect x="0" y="0" width="40" height="38"></rect></g></svg>
            : star === 0.5 
            ? <img 
                className="half" 
                src={starHalf} /> 
            : <img
                className="empty" 
                src={starEmpty} />
        }
        </>
    )
}
